    "build": {
      "vllm-cuda-manifest": {
        "command": "  cd /home/daedalus/dev/builds/build-vllm-cuda\n\n  # Clone vLLM source\n  git clone --depth 1 --branch v0.12.0 https://github.com/vllm-project/vllm.git vllm-src || true\n  cd vllm-src\n\n  # Build and install\n  export VLLM_TARGET_DEVICE=cuda\n  export VLLM_BUILD_WITH_CUDA=1\n  export TORCH_CUDA_ARCH_LIST=\"7.0;7.5;8.0;8.6;8.9;9.0\"\n\n  python3 -m pip install --no-deps --prefix=$out .\n\n  # Create wrapper script\n  mkdir -p $out/bin\n  echo '#!/usr/bin/env python3' > $out/bin/vllm\n  echo 'import sys; sys.path.insert(0, \"'$out'/lib/python3.11/site-packages\"); from vllm.entrypoints.api_server import main; main()' >> $out/bin/vllm\n  chmod +x $out/bin/vllm\n",
        "sandbox": "off",
        "version": "0.12.0",
        "description": "vLLM with CUDA support - built with manifest mode"
      }
    }
